import React from "react";
import ReactMarkdown from "react-markdown";
import BlogNavbar from "../../components/BlogNavbar";
import Sidebar from "../../components/Sidebar";
import { render } from "react-dom";
import "../../components/common.css";

const JsIndex0 = () => {
  const input = "{}";
  return (
    <div className="wrapper">
      <BlogNavbar />
      <div className="container">
        <Sidebar />
        <div className="contents">
          <h4 id="-">고차 함수</h4>
          {input}
          <h4 id="-">자바스크립트 엔진의 종류</h4>
          <ul>
            <li>
              V8 - 오픈소스로 구글에서 개발했다. C++로 작성되었고 구글 크롬과
              Node.js에서 사용된다. 가장 유명한 엔진.
            </li>
            <li>
              SpiderMonkey - 최초의 자바스크립트 엔진. 지금은 모질라
              파이어폭스에 사용된다.
            </li>
            <li>
              Rhino - 모질라 재단에서 운영, 오픈소스이고 자바로 개발되었다.
            </li>
            <li>JavaScriptCore, Chakra, Nashron, JerryScript 등등</li>
          </ul>
        </div>
      </div>
    </div>
  );
};

export default JsIndex0;
